    public void copyArrayTest() {
        List<Map<String, Object>> srcList = new ArrayList<>();
        Map<String, Object> srcMap = new HashMap<>();
        srcMap.put("log_type", 1);
        srcMap.put("time", DateUtils.dateTimeNow(DateUtils.YYYY_MM_DD_HH_MM_SS));

        srcList.add(srcMap);

        List<Map<String, Object>> dstList = CollectionUtil.newCopyOnWriteArrayList(srcList);

        Iterator<Map<String, Object>> iterator = srcList.iterator();
        Map<String, Object> dstMap = null;
        while (iterator.hasNext()) {
            dstMap = iterator.next();
            increaseElement("time", "event_time", dstMap);
            increaseElement("log_type", "report_log_type", dstMap);
            dstMap.put("guid", Uuid.uuid());
        }
    }




